import "../App.css";
import "../stylesheets/Project.css";
import Card from "react-bootstrap/Card";

function Project(props) {
  return (
    <div className="Project">
      <p>poop</p>
      <div class="card">
        <a
          title="competitive programming"
          href="https://github.com/emmanuel-bob-ma-joey/dmoj-problems"
          target="_blank"
          rel="nofollow"
        ></a>
        <div class="card-body">
          <h5 class="card-title">Competitive Programming</h5>
          <p class="card-text">
            solving coding problems by implementing different algorithms
            pertaining but not limited to DP and graph theory.{" "}
          </p>
          <button
            style="margin-bottom: -3em;"
            type="button"
            class="btn btn-dark"
          >
            Python
          </button>
        </div>
      </div>
    </div>
  );
}

export default Project;
